It is common to compose neural networks with layers. Layers represent functions, but may also store both parameters like weights, and hyper parameters like the padding of a convolution. Layers make it easy to define a model, as they translate hyper parameters into the shape of the parameters. For example, you could create a simple Dense layer with this: let w = Parameter::new( ArcTensor::zeros(&device, `[outputs, inputs]`)
);
let b = Parameter::new( ArcTensor::zeros(&device, outputs)
); // forward let y = x.dense(&w, Some(&b)); Or you could use a Dense layer: let dense = Dense::builder() .device(&device) .inputs(inputs) .outputs(outputs) .build(); /// forward
let y = x.forward(&dense);

