/// Trait for forward pass, implemented by layers\
/// Typically this will call a method or custom Trait method on Variable\
/// A layer like Conv2d will implement Forward, and a model composed of layers will also implement forward.
pub trait Forward<D: Dimension> { type OutputDim: Dimension; fn forward(&self, input: &Variable<D>) -> Variable<Self::OutputDim>;
} The Forward trait is used to compute the output given the input. When training, backward ops are enqueued into the graph attached to the input. The Layer and Forward traits combine to form the common interface of all layers / models.

24.body:
Implementing forward for a struct is straightforward. For an image classifier, the input will be a Variable4 (NCHW), with D = Ix4, and the output will be Variable2 (NC). Use Variable's forward() method to sequence several methods, like this: struct ConvNet { conv: Conv2d, dense: Dense
} impl Forward<Ix4> for ConvNet { // type OutputDim = Ix2; fn forward(&self, input: &Variable4) -> Variable2 { input .forward(&self.conv) .relu() .flatten() .forward(&self.dense) }
} Similar to how Layer can be derived, Forward can be implemented with the impl_forward macro. We have to add the Relu and Flatten layers to our struct: #[impl_forward(Ix4, Ix2)]
#[derive(Layer)]
struct ConvNet ( Conv2d, Relu, Dense, Flatten
); Note that Rust has zero sized types. Relu and Flatten have no cost, they will only affect the derived implementations, not the size of the struct. Now you only have to write a constructor for the model, potentially something like this: impl ConvNet { pub fn new(device: &Device) -> Self { let conv = Conv2d::builder() .device(device) .inputs(1) .outputs(8) .args( Conv2dArgs::default() .kernel(7) ) .build(); let relu = Relu::default(); let flatten = Flatten::default(); let Dense = Dense::builder() .inputs(8*22*22) .outputs(10) .bias() .build(); ConvNet( conv, relu, flatten, dense ) }
} When developing it may be useful to experiment with several models. You can hide the type of the model in a few ways: // some models, with a new method like above
struct Model1 { .. }
struct Model2 { .. } // define a type alias for use in training code
type MyModel = ConvNet; // ConvNet2 fn train() { let device = Device::default(); let model = MyModel::new(&device);
} // use a function that returns impl Trait fn create_model(device: &Device) -> impl Layer + Forward<Ix4, Output=Ix2> { Model1::new(device) // Model2::new(device)
} fn train() { let device = Device::default(); let model = create_model();
} Use a boxed dyn Trait: #[impl_forward(Ix4, Ix2)]
#[derive(Layer)]
struct DynModel(Box<dyn (Layer + Forward<Ix4, OutputDim=Ix2>)>); impl DynModel { fn new(device: &Device) -> Self { let model = Model1::new(device) // Model2::new(device) DynModel(Box::new(model)) }
}

3.body:
A Device represents either a cpu or gpu. Generally the gpu has its own memory. Transferring data from cpu to gpu memory is relatively expensive compared to executing operations. Generally operations can only be performed on data that is in a particular device's memory, at least multi device operations are slower than single device operations. In autograph, a Device is an enum: #[derive(Clone, Debug)]
pub enum Device { Cpu(Arc<Cpu>), #[cfg(feature = "cuda")] Cuda(Arc<CudaGpu>),
} This represents either a Cpu or CudaGpu (potentially more in the future). A Device can be created from a Cpu or CudaGpu using the From trait: let cpu = Device::from(Cpu::new());
let gpu = Device::from(CudaGpu::new(0)); // Get the first gpu Device also implements Default, which can be used to get a device, potentially the first gpu if available: let device = Device::default(); Device can be cloned, which clones the internal Arc (a threadsafe shared pointer). Devices cloned this way refer to the same object. The Cpu and CudaGpu structs store handles used to execute operations on with the backends (oneDNN and cuDNN for example).

4.body:
GPU operations are typically asynchronous with respect to the host. Allocations and transfers typically block the host thread, while operations like convolutions are simply enqueued and do not block. In a typical pattern, data is copied to the gpu, the operations are carried out, and the output is copied back to the host. No explicit synchronization is necessary, in fact the CUDA runtime synchronizes as needed. To explicity synchronize, and wait for all operations on the gpu to finish, call Device::synchronize(): let device = Device::from(CudaGpu::new());
let x = Tensor::<u8>::ones(&device, 10) .to_one_hot_f32(16);
// wait for execution to finish
device.synchronize(); This can be useful for timing / benchmarking.

